import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import axios from 'axios';
import 'C:/KLU/Y23-24/Mern/New folder/newapp/src/App.css';
import { useState } from 'react';
import { Navigate, useNavigate } from 'react-router-dom';

const defaultTheme = createTheme();



export default function CreateFlight(){
    const [planecode, setCode] = useState()
    const [departairport, setDepart] = useState()
    const [arriveAirport, setArrive] = useState()
    const [seats, setSeats] = useState()

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.get('http://localhost:8081/createflight', {PlaneCode: planecode, departairport: departairport, arriveAirport : arriveAirport, seats:seats})
      .then( response => {
        console.log(response.data)
      })
      .catch(err=>{console.log(err)})

    return(
       
        <ThemeProvider theme={defaultTheme}  >
            
        <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
        
          sx={{
            margin: -5,
            marginTop: 10,
            marginBottom:5,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            boxShadow: '0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)',
            padding: '1.5rem',
            opacity: '75%',
            backgroundColor: 'white',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
            <LockOutlinedIcon/>
          </Avatar>
          <Typography component="h1" variant="h5">
            Register
          </Typography>
          <Box component="form" onSubmit={handleSubmit}>
            <Grid container spacing={1} >
              <Grid item xs={12} sm={6}>
                <TextField
                margin='normal'
                required
                id='fname'
                label='First Name'
                name='fname'
                value = {arriveAirport}
                onChange={(e) => setArrive(e.target.value)}
                />
                </Grid>
              <Grid item xs={12} sm={6}>
            <TextField
              margin='normal'
              id="lname"
              label="Last Name"
              name='lname'
              value={departairport}
              onChange={(e) => setDepart(e.target.value)}
            />
                </Grid>
              <Grid item xs={12}>
              <TextField
                margin='normal'
                fullWidth
                id='uname'
                label='Username'
                name='uname'
                value={planecode}
                onChange={(e) => setCode(e.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
            <TextField
                margin="normal"
                required
                fullWidth
                id="email"
                label="Email Address"
                name="email"
                autoComplete="email"
                autoFocus
                value={seats}
                onChange={(e) => setSeats(e.target.value)}
              />
            </Grid>

            <FormControlLabel
              control={<Checkbox value="remember" color="primary" />}
              label="Remember me"
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2}}
              id="SignBox"
              >
              Sign In
            </Button>
            <Grid container>
              <Grid item xs>
                <Link href="/login" variant="body2">
                  Have an Account?
                </Link>
              </Grid>
            </Grid>
            </Grid>
          </Box>
        </Box>
      </Container>
      </ThemeProvider>
    )
 }
}
